webpackJsonp([0xc360e14db95c],{9107:function(t,e){t.exports={pathContext:{group:[{node:{fields:{title:"Foggy Bottom",date:"17 Nov 2001",slug:"/2001-11-17-foggy-bottom/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/actionman.jpg" height="244" width="325" border="0" alt="actionman.jpg: " /></p>\n<p>John thinks this picture shows that we <a href="http://iowa.weblogger.com/2001/11/17">let Christopher play with dynamite</a>. While that does look like an explosion behind him to the right, Christopher is actually destructive enough without the help of explosives.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/computer.jpg" height="244" width="325" border="0" alt="computer.jpg: " /></p>\n<p>Thanks, <a href="http://blackholebrain.editthispage.com/"> Mike</a>, for noticing that I forgot to include captions for the pictures this morning and <a href="http://blackholebrain.editthispage.com/2001/11/16">supplying your own</a>. At least I should be thankful that I\'m not the subject of <a href="http://blackholebrain.editthispage.com/2001/11/17">the latest caption contest</a>. Although that mullah looks like he just opened Christopher\'s diaper pail.</p>'},next:{fields:{title:"Ohne Holland",date:"16 Nov 2001",slug:"/2001-11-16-ohne-holland/"}},previous:{fields:{title:"Rockaway Beach",date:"19 Nov 2001",slug:"/2001-11-19-rockaway-beach/"}}},{node:{fields:{title:"Ohne Holland",date:"16 Nov 2001",slug:"/2001-11-16-ohne-holland/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/crhhoover.jpg" height="342" width="325" border="0" alt="crhhoover.jpg: " /></p>\n<p>Christopher just rolled out the vacuum cleaner, pulled out the cord, plugged it into an supposedly child-proofed socket, turned it on, and started vacuuming. </p>\n<p>Dave\'s Picks: <a href="http://davespicks.com/misc/mightbefrommn.html">You might be from Minnesota if....</a>  Despite being away for so long, I answered almost all of these correctly. Scary.</p>\n<p>There are times when a book is better than the web. I wanted to check up on Perl\'s  "|=" operator... but try search for that on <a href="http://www.google.com/search?q=PapaScott&btnG=Google+Search">Google</a>!<br />\n It doesn\'t work all that well. Turns out I really wanted ||= anyway.</p>\n<p>JÃ¶rg has written a <a href="http://dilett.antville.org/20011115/2437/">detailed review</a> (in German) of <a href="http://radio.userland.com">Radio Userland</a> at <a href="http://dilett.antville.org">dilettantville</a>. It\'s so detailed that Google cannot translate it all at one time.</p>'},next:{fields:{title:"Eat Your Cake",date:"15 Nov 2001",slug:"/2001-11-15-eat-your-cake/"}},previous:{fields:{title:"Foggy Bottom",date:"17 Nov 2001",slug:"/2001-11-17-foggy-bottom/"}}},{node:{fields:{title:"Eat Your Cake",date:"15 Nov 2001",slug:"/2001-11-15-eat-your-cake/",tags:"Y2001"},html:"<p>Christopher could get a new cousin today, as his uncle Roland brought aunt Kirsten to the hospital last night. Today is both Kirsten's and Roland's birthday. Three birthdays on the same day in the same family? <b>Update:</b> It's a girl... Lily is her name! 5200 g, 56 cm long, born at 2:30 pm. Now Christopher is no longer the baby of the family.</p>"},next:{fields:{title:"Don't Panic",date:"12 Nov 2001",slug:"/2001-11-12-dont-panic/"}},previous:{fields:{title:"Ohne Holland",date:"16 Nov 2001",slug:"/2001-11-16-ohne-holland/"}}}],pathPrefix:"",first:!1,last:!1,index:960,pageCount:1101}}}});
